import React from "react";
import Login from "../Form/Login.js";
import Register from "../Form/Register.js";

const Auth = ({ authRender }) => {
    return (
        <>
            {authRender === "login" && <Login />}
            {authRender === "register" && <Register />}
        </>
    );
};

export default Auth;
